// src/App.js

import React, { Component } from 'react';
import Locales from './components/locales';

class App extends Component {

  state = {
    locales: []
  }

  componentDidMount() {
    fetch('/api/v1/locales')
    //.then(res => res.json())
    .then(res => res.text())
    .then(console.log)
    //.then((data) => {
    //  this.setState({ locales: data })
    //})
    //.catch(console.log)
  }

  render() {
    return (
        <div>
          <center><h1>Locale List</h1></center>
          {locales.map((locale) => (
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{locale.name}</h5>
                <h6 class="card-subtitle mb-2 text-muted">{locale.email}</h6>
                <p class="card-text">{locale.company.catchPhrase}</p>
              </div>
            </div>
          ))}
        </div>
    )
  }
}

export default App;
